#sequence_list should look like:
#   [['activity 1', 'activity 2', ...], [...], ...]
def get_best_k(sequence_list, method="ASW") :

    # transform sequence list in a string
    def format_it_to_r(sequence_list):
        output = ''
        for s in sequence_list:
            for activity in s:
                output += str(xes.activity_list.indice(activity))+'-'
            output = output[:-1]+'#'

        return output[:-1]


    robjects.r('''
        suppressMessages(library(WeightedCluster))
        suppressMessages(library(TraMineR))
        suppressMessages(library(cluster))
        input <- "''' + format_it_to_r(sequence_list) + '''"
        f = file()
        sink(file=f)
        data <- (scan(text=input, what='', sep='#', quiet = TRUE))
        famform.seq <- seqdef(data)
        couts <- seqsubm(famform.seq, method = "TRATE")
        distance <- seqdist(famform.seq, method = "OM", sm = couts)
        agnesRange <- wcKMedRange(distance, 2:8)
        summary <- (summary(agnesRange, max.rank = 1))
        sink()
        close(f)
        k <- summary["'''+method+'''", 1]
        ''')
    output = robjects.r['k']
    return int(output[0])


